<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
</head>
<body>
    <script>
        console.log("log")
        console.info("info")
        console.warn("warn")
        console.error("error")
        console.assert("err" !=false)
        console.assert("err" ==false)
        console.time("dhamo")
        console.timeEnd("dhamo")

        console.time("forloop")

        for(let i=0;i<5;i++){
            console.log(233)
        }

        console.timeEnd("forloop")
        console.time("whileloop")

        let i
        while(i<5){
            console.log(233)
        }

        console.timeEnd("whileloop")
    </script>
</body>
</html>
